import React from "react"

function NextButton({card, index, cardSide, nextCard}) {
    if (cardSide === "back") {
        return (
            <button onClick={nextCard()} className="btn btn-primary">
                Next
            </button>
        )
    } else if (cardSide === "front") {
        return null
    }
}

export default NextButton
